function App() {
  return (

  <div>


     <Header1/>  

     <BrowserRouter> 
      <Routes>
      <Route path="/" exact element={<Home />} />

          <Route path="/products" element={<Product />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />





     </Routes> 

 </BrowserRouter>  
 </div>
  );
}

export default App;
